import React from 'react'

function Locations({setLocation}) {
  return (
    <div class = "col-2 pt-4">
          <input placeholder='Search Locations'/>
          <br/><br/>
          <label>
          <input type = "radio" onChange = {()=>{
            setLocation({
              lat : "17.4485835",
              long : "78.39080349999999"
            })
            }}
             name = "location"/> Madhapur</label><br/>
          <label>
          <input type = "radio" onChange = {()=>{
            setLocation({
              lat : "17.492838",
              long : "78.54690149999999"
            })}} name = "location"/> Sainikpuri</label>
        </div>
  )
}

export default Locations
